  false,\n\t\"url\": null,\n\t\"notes\": \"The Northeast Fisheries Science Center's
  Social Sciences Branch (SSB) conducted a survey of vessel owners participating in
  commercial fisheries in the New England and Mid-Atlantic regions.  The survey was
  mailed to approximately 1,400 vessel owners holding federal fishing permits in New
  England and the Mid-Atlantic on September 13, 2013.  As of January 13, 2014, 157
  surveys were returned (138 by mail and 19 online).\",\n\t\"license_title\": null,\n\t\"extras\":
